import React from 'react'
import CarroDesestruturarPropriedades from './modulo05/CarroDesestruturarPropriedades'

const CarroDesestruturarPropriedadesVetor = ({ carros = [] }) => {

  return (
    <ol>
      {carros.map((carro, index) => (
        <li key={index}>
          <CarroDesestruturarPropriedades
            marca={carro.marca}
            km={carro.km}
            cor={carro.cor}
            zero={carro.zero}
          />
        </li>
      ))}
    </ol>
  )
}

export default CarroDesestruturarPropriedadesVetor
